import React, { useEffect, useState } from 'react';

function AIVisual() {
  const [activeDataset, setActiveDataset] = useState(0);
  const [hoveredPoint, setHoveredPoint] = useState(null);

  // Generate sample data
  const generateData = (points) => {
    return Array.from({ length: points }, (_, i) => ({
      x: i,
      y: 50 + Math.sin(i * 0.5) * 20 + Math.random() * 15,
      value: Math.random() * 100
    }));
  };

  const datasets = [
    generateData(20),
    generateData(20),
    generateData(20)
  ];

  useEffect(() => {
    const timer = setInterval(() => {
      setActiveDataset(prev => (prev + 1) % datasets.length);
    }, 3000);
    return () => clearInterval(timer);
  }, []);

  return (
    <div style={{
      position: 'relative',
      width: '600px',
      height: '600px',
    }}>
      {/* Background Grid */}
      <svg width="100%" height="100%" style={{ position: 'absolute' }}>
        <defs>
          <pattern id="grid" width="40" height="40" patternUnits="userSpaceOnUse">
            <path d="M 40 0 L 0 0 0 40" fill="none" stroke="#1E293B" strokeWidth="0.5" />
          </pattern>
        </defs>
        <rect width="100%" height="100%" fill="url(#grid)" />
      </svg>

      {/* Main Visualization */}
      <svg width="100%" height="100%" style={{ position: 'relative' }}>
        {/* Scatter Plot */}
        {datasets[activeDataset].map((point, i) => (
          <g key={i}>
            <circle
              cx={point.x * 30}
              cy={point.y * 2}
              r={point.value / 20}
              fill={`rgba(97, 218, 251, ${point.value / 200})`}
              stroke="#61DAFB"
              strokeWidth="1"
              onMouseEnter={() => setHoveredPoint(i)}
              onMouseLeave={() => setHoveredPoint(null)}
            >
              <animate
                attributeName="r"
                values={`${point.value / 20};${point.value / 15};${point.value / 20}`}
                dur="3s"
                repeatCount="indefinite"
              />
            </circle>

            {/* Connection Lines */}
            {i < datasets[activeDataset].length - 1 && (
              <line
                x1={point.x * 30}
                y1={point.y * 2}
                x2={datasets[activeDataset][i + 1].x * 30}
                y2={datasets[activeDataset][i + 1].y * 2}
                stroke="#61DAFB"
                strokeWidth="0.5"
                strokeOpacity="0.3"
              >
                <animate
                  attributeName="strokeOpacity"
                  values="0.3;0.6;0.3"
                  dur="2s"
                  repeatCount="indefinite"
                />
              </line>
            )}
          </g>
        ))}

        {/* Floating Data Labels */}
        {['Accuracy', 'Loss', 'Validation'].map((label, i) => (
          <text
            key={label}
            x={150 + i * 120}
            y={550}
            fill="#8F9BA8"
            fontSize="14"
            textAnchor="middle"
          >
            {label}
            <animate
              attributeName="y"
              values={`${550};${545};${550}`}
              dur={`${2 + i * 0.5}s`}
              repeatCount="indefinite"
            />
          </text>
        ))}
      </svg>

      {/* Floating Stats */}
      {[
        { label: 'Accuracy', value: '98.2%' },
        { label: 'F1 Score', value: '0.94' },
        { label: 'Loss', value: '0.023' }
      ].map((stat, i) => (
        <div
          key={stat.label}
          style={{
            position: 'absolute',
            top: 100 + i * 80,
            right: 50,
            background: 'rgba(30, 41, 59, 0.8)',
            padding: '15px 20px',
            borderRadius: '12px',
            backdropFilter: 'blur(10px)',
            animation: `float ${2 + i * 0.5}s infinite ease-in-out`,
          }}
        >
          <div style={{ color: '#8F9BA8', fontSize: '14px' }}>{stat.label}</div>
          <div style={{ color: '#61DAFB', fontSize: '24px', fontWeight: 'bold' }}>{stat.value}</div>
        </div>
      ))}
    </div>
  );
}

export default AIVisual;
